'use strict';

import './App.css';
import React from 'react';
import client from './client';

export default class App extends React.Component {
	constructor(props) {
		super(props);
		this.state = {tabletopSystems: []};
	}

	componentDidMount() {
		client({method: 'GET', path: '/api/tabletopSystems'}).done(response => {
			this.setState({tabletopSystems: response.entity._embedded.tabletopSystems});
		});
	}

	render() {
		return (
			<div className="App">
				<header className="App-header">
					<table>
						<tbody>
							<tr>
								<th>Name</th>
							</tr>
							{this.state.tabletopSystems.map(system =>
								<tr key={system._links.self.href}>
									<th>{system.name}</th>
								</tr>
							)}
						</tbody>
					</table>
				</header>
			</div>
		);
	}
}
